import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import ExerciseList from './components/ExerciseList.js';


function App() {

  return (
    <Router>
      <div className="content">
        <Switch>
          <Route path="/add-workout">

          </Route>
        </Switch>
        <ExerciseList />
      </div>
    </Router>
  );
}

export default App;
